import {useState, useRef} from "react"

let separator = { 
  display: "inline-block",
  position: "absolute",
  width: "1px",
  backgroundColor: "#4382BC"
}

function renderObject(selector, orig, value, indent) {
  
  if (selector === "Phones") {
    let height = Object.keys(orig).length*10
    console.log(height)
  }
  return
  if (value === null) return (
    <div 
    onMouseEnter={e => {e.currentTarget.style.backgroundColor = "#b7eef5"}}
    onMouseLeave={e => {e.currentTarget.style.backgroundColor = "white"}}
    style={{display: "flex"}}>
      <div style={{width: "50%", textIndent: `${indent*15+5}px`}}>{selector}</div>
      <div style={{width: "50%", direction: "rtl", textIndent: "5px"}}>null</div>
    </div>
  )
  
  if (typeof(value) === "object") {
    return (
      <div style={{cursor: "pointer"}}>
        <div 
          onMouseEnter={e => {e.currentTarget.style.backgroundColor = "#b7eef5"}}
          onMouseLeave={e => {e.currentTarget.style.backgroundColor = "white"}}
          style={{textIndent: `${indent*15+5}px`}}>{selector}
        </div>
        <div>
          {/* <div style={{...separator, margin: `2px 5px 0 ${indent*15+8}px`, height: `${height}px`}}></div> */}
          {function() { 
            return Object.keys(value).map((new_selector) => (
              renderObject(new_selector, value, value[new_selector], indent+1)
            ))
          }()}
        </div>
      </div>
    )
  }
  
  else return (
    <div 
        onMouseEnter={e => {e.currentTarget.style.backgroundColor = "#b7eef5"}}
        onMouseLeave={e => {e.currentTarget.style.backgroundColor = "white"}}
        style={{display: "flex"}}>
      <div style={{width: "50%", textIndent: `${indent*15+5}px`}}>{selector}</div>
      <div style={{width: "50%", direction: "rtl", marginRight: "5px"}}>{value}</div>
    </div>
  )
  
}

//Extends FocusedDataList
export default function FocusedDataItem({itemObject}) {
  return Object.keys(itemObject).map((item) => (
    renderObject(item, itemObject, itemObject[item], 0)
  ))  
}
